import React from 'react';
import Button from 'antd/lib/button';
import './App.css';
import Demo from './DirTree.js'

function App() {
  return (
    <div className="App">
        <Demo></Demo>
        <Button type="primary">Button</Button>
      </div>
  );
}


export default App;
